import {Button, Card, Col, Container, Row} from 'react-bootstrap';
import Plans from './helpers/plans-helper';


export default class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            }
        this.bind();
        };
    bind() {
        this.redirectFromWhats = this.redirectFromWhats.bind(this);
    }

    redirectFromWhats(){
        return window.open("https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0")
    }

    render() {
        return (
        <>
            <Container>
                <Row>
                <span>Dr. Leonardo Simões</span>
                <br/>
                <span>Nutrição Clínica e Esportiva</span>
                <Button id='button-home' onClick={() => this.redirectFromWhats()}>
                    <i className="bi bi-whatsapp"></i>
                    Agendar consulta
                </Button>
                </Row>
                <Row>
                    <img></img>
                    <span>

                    </span>
                </Row>
                <Row>
                    <h1>Como funcionam os planos</h1>
                    {Plans.map(plan =>
                            <Card>
                                <Card.Body>
                                    <span>{plan.title}</span>
                                    <br/>
                                    <span>{plan.description}</span>
                                </Card.Body>
                            </Card>
                        )}
                </Row>
                <Row>
                    {Plans.map(plan =>
                        <Card>
                            <Card.Body>
                                <span>{plan.title}</span>
                                <span>{plan.description}</span>
                            </Card.Body>
                        </Card>
                    )}
                </Row>
                <Row>
                    <Col>
                   <Row>Contatos</Row>
                        <Row>
                            <i>whats</i>
                            <span>(11) 948816521</span>
                            <br/>
                            <i>insta</i>
                            <span>nutri.leosimoes</span>
                            <br/>
                            <i>local</i>
                            <span>Rua Coronel Pedro Dias de Campos, 1044 - Vila Matilde</span>
                        </Row>
                    </Col>
                    <Col>
                        {/*<img>mapa</img>*/}
                    </Col>
                </Row>
            </Container>
        </>
        )
    }
}
